import React, { useEffect, useState } from "react";

const Apicall = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:3030/Users").then((result) => {
      result.json().then((resp) => {
        // console.warn("result",resp)
        setData(resp);
      });
    });
  }, []);
  console.warn(data);
  return (
    <div className="App">
      <h1>Get call Api</h1>
      <table>
        <tr>
          <td>Id</td>
          <td>Name</td>
          <td>Email</td>
          <td>Address</td>
        </tr>
        {data.map((item) => (
          <tr>
            <td>Id</td>
            <td>Name</td>
            <td>Email</td>
            <td>Address</td>
          </tr>
        ))}
      </table>
    </div>
  );
};

export default Apicall;
